package com.kian;

import java.nio.ByteBuffer;
import java.nio.charset.Charset;
import java.util.Base64;

/**
 * @author gaojian
 * @date 2022-03-22 13:33:22
 * @description ByteBuffer -> java.nio.BufferOverflowException
 */
public class NioTest {
    public static void main(String[] args) {
        int lineNumber = 0;
        Charset CHARSET = Charset.availableCharsets().get("UTF-8");
        String input = "";
        ByteBuffer base64Buffer = ByteBuffer.allocate(100000);
        System.out.println("1. position: " + base64Buffer.position());
        System.out.println("1. remaining: " + base64Buffer.remaining());
        System.out.println("1. limit: " + base64Buffer.limit());
        System.out.println("input length: " + input.length());
        byte[] decodedData = Base64.getDecoder().decode(input.getBytes());
        System.out.println("decodedData length: " + decodedData.length);
        // base64Buffer.put(decodedData);

        base64Buffer = ByteBuffer.allocate(decodedData.length);
        base64Buffer.put(decodedData);
        System.out.println("2. position: " + base64Buffer.position());
        System.out.println("2. remaining: " + base64Buffer.remaining());
        System.out.println("2. limit: " + base64Buffer.limit());
        System.out.println("2. capacity: " + base64Buffer.capacity());
        base64Buffer.flip();
        System.out.println("3. position: " + base64Buffer.position());
        System.out.println("3. remaining: " + base64Buffer.remaining());
        System.out.println("3. limit: " + base64Buffer.limit());
        System.out.println("3. capacity: " + base64Buffer.capacity());
        int countDoubleQuotation = 0;
        for (int i = 0; i < base64Buffer.limit(); i++) {
            if (base64Buffer.get(i) == 34) {
                countDoubleQuotation++;
            }

            if (base64Buffer.get(i) == 10 && countDoubleQuotation % 2 == 0) {
                lineNumber++;
                countDoubleQuotation = 0;
                byte[] data = new byte[i - base64Buffer.position()];
                base64Buffer.get(data);
                base64Buffer.get();
                // processor.insertRow(new String(data, CHARSET), lineNumber);
                System.out.println("lineNumber: " + lineNumber);
                System.out.println("---> insertRow: " + new String(data, CHARSET));
            }
        }
        byte[] data = new byte[base64Buffer.limit() - base64Buffer.position()];
        base64Buffer.get(data);
        base64Buffer.clear();
        base64Buffer.put(data);
        System.out.println("position: " + base64Buffer.position());
        System.out.println("remaining: " + base64Buffer.remaining());
        System.out.println("limit: " + base64Buffer.limit());
    }
}
